var ns4 = document.layers;
var ie4 = document.all;
var itemparar = 0;
var ultimox = 0;
var ultimoy = 0;
var parartudo = 0;

function pararMovimento(id){
	itemparar = id;
}

function iniciarMovimento(){
	itemparar = 0;
}

function clicMostrarAnuncio(id){
	itemparar = 1;

	document.getElementById(id).remove();
	
	if ( document.getElementById('aegypti-intervencao') == null)
	{
	mydiv = document.getElementById("Mydiv-mosquito");
	div = document.createElement("div");
	document.body.insertBefore(div, mydiv);
	div.innerHTML = "<div id='aegypti-intervencao'><a href='http://combateaedes.saude.gov.br/' id='aegypti-banner' target='_blank' title='Faça sua parte'><img src='data:image/png;base64,' alt='Não adianta apenas matar o mosquito. Não podemos deixar ele nascer. E isso depende de todos nós.'></a><a href='#' id='aegypti-close' title='Fechar'>Fechar</a></div>";
	
	document.getElementById('aegypti-close').onclick = function(){ CloseAnuncio();};
	}
}

function CloseAnuncio(){
	document.getElementById('aegypti-intervencao').remove();
}

JSFX.makeLayer = function(id)
{
	var el = 	document.getElementById	? document.getElementById(id) :
				document.all ? document.all[id] : document.layers[id];
							  
	document.getElementById(id).onmouseout   = function(){ iniciarMovimento(id);};
	document.getElementById(id).onmousemove  = function(){ pararMovimento(id);};
	document.getElementById(id).onclick 	 = function(){ clicMostrarAnuncio(id);};
	
	
	if(ns4) el.style=el;
	el.sP=function(x,y){
	
		
		var w = window.screen.availWidth;
		var h = window.screen.availHeight;
		
		w = document.documentElement.clientWidth-100;
		h = document.documentElement.clientHeight-100;

		if ( x > w ){x = w}
		if ( y > h ){y = h}
		
		if ( x < 0 ){x = 10}
		if ( y < 0 ){y = 10}
		
		this.style.left = x;
		this.style.top=y;
		
		var clazz = '';
		
		if (ultimox-6 < x){clazz = 'aegypti flipAE flyAE';}else{ clazz = 'aegypti flyAE';}
		
		this.setAttribute("class",clazz);
		
		ultimox = x;
		ultimoy = y;
		
		//console.log(el.state);
		
		//console.log('x:'+x+' w'+w);
		//console.log('y:'+y+' h'+h);
	
	};
	
	el.show=function(){ this.style.visibility = "visible"; } 
	el.hide=function(){ } 
	
	if(ns4 || window.opera) 
		el.sO = function(pc){return 0;};
	else if(ie4)
		el.sO = function(pc)
		{
			if(this.style.filter=="")
				this.style.filter="alpha(opacity=100);";
			this.filters.alpha.opacity=pc;
		}
	else
		el.sO = function(pc){this.style.MozOpacity=pc/100;}

	return el;
}

if(window.innerWidth)
{
	gX=function(){return innerWidth;};
	gY=function(){return innerHeight;};
}
else
{
	gX=function(){return document.body.clientWidth-30;};
	gY=function(){return document.body.clientHeight-30;};
}
JSFX.ghostOutput=function()
{
	for(var i=0 ; i<JSFX.ghostImages.length ; i++)
		document.write(ns4 ? "<LAYER  NAME='gh"+i+"'>"+JSFX.ghostImages[i]+"</LAYER>" : 
					   "<DIV id='gh"+i+"' style='position:absolute'>"+JSFX.ghostImages[i]+"</DIV>" );
	
}
JSFX.ghostSprites = new Array();
JSFX.ghostStartAni = function(tempo)
{
	for(var i=0 ;i<JSFX.ghostImages.length;i++)
	{
		var el=JSFX.makeLayer("gh"+i);
		el.x=Math.random()*gX();
		el.y=Math.random()*gY();
		el.tx=Math.random()*gX();
		el.ty=Math.random()*gY();
		el.dx=-5+Math.random()*10;
		el.dy=-5+Math.random()*10;
		el.state="off";
		el.op=0;
		el.sO(el.op);
		el.hide();
		JSFX.ghostSprites[i] = el;
	}
	setInterval("JSFX.ghostAni()", tempo);
}
JSFX.ghostAni = function()
{
	if (parartudo == 0){
	
		for(var i=0 ;i<JSFX.ghostSprites.length;i++)
		{
			el=JSFX.ghostSprites[i];
			
			if (itemparar != el.id){
			
			if(el.state == "off")
			{
				if(Math.random() > .99)
				{
					el.state="up";
					el.show();
				}
			}
			else if(el.state == "on")
			{
				if(Math.random() > .98)
					el.state="down";
			}
			else if(el.state == "up")
			{
				el.op += 2;
				el.sO(el.op);
				if(el.op==100)
					el.state = "on";
			}
			else if(el.state == "down")
			{
				el.op -= 2;
				if(el.op==0)
				{
					el.hide();
					el.state = "off";
				}
				else
					el.sO(el.op);
			}

			var X = (el.tx - el.x);
			var Y = (el.ty - el.y);
			var len = Math.sqrt(X*X+Y*Y);
			if(len < 1) len = 1;
			var dx = 20 * (X/len);
			var dy = 20 * (Y/len);
			var ddx = (dx - el.dx)/10;
			var ddy = (dy - el.dy)/10;
			el.dx += ddx;
			el.dy += ddy;
			el.sP(el.x+=el.dx,el.y+=el.dy);

			if(Math.random() >.95 )
			{
				el.tx = Math.random()*gX();
				el.ty = Math.random()*gY();
			}
			
			}

		}
	}
	
}
JSFX.ghostStart = function()
{
	if(JSFX.ghostLoad)JSFX.ghostLoad();
	JSFX.ghostStartAni(100);
	
}

JSFX.ghostOutput();
JSFX.ghostLoad=window.onload;
window.onload=JSFX.ghostStart;

